// ComponentA.js
import React from 'react';
import withTimeTracking from '../../hoc/withTimeTracking';

const ComponentA = ({ timeSpent }) => {
  return <div>Time spent on Component A: {timeSpent} seconds</div>;
};

export default withTimeTracking(ComponentA);
